The Republican Budget guts Medicaid & SNAP all to pay for tax cuts that only benefit billionaires.

@LiuNewYork & I hosted a roundtable in Flushing to highlight the devastating impact this bill will have on Queens families.

I'm all for cutting wasteful government spending, but affordable health care & feeding hungry families is NOT waste.

I saw the crucial need for repairs firsthand when I visited @FDNY Squad 288-HazMat 1 in Maspeth. Our firefighters work, sleep & eat here. 

That’s why I’ve been fighting for federal funding to help make these long-overdue repairs & upgrades at this firehouse. 

@Rich_Calder @UFANYC @JoannAriola32

The DOJ recklessly canceled the three largest programs fighting hate crimes, including the program I helped establish in 2022.

@AGPamBondi said she would work with me to bring these programs back. I am going to hold her to that promise.
https://t.co/fJJqkhFgmx

The President wants to cut FBI funding by half a billion dollars. 

@FBIDirectorKash came to Congress and told us the FBI needs an $11.2B budget to protect the American people.

@AppropsDems are willing to work seriously with Director Patel to give our FBI agents all the resources they need to fight violent crime, the fentanyl crisis, & terrorism.

In December, 256,000 jobs were added to the economy.

@POTUS added jobs every single month of his term.

That's 16.6 MILLION jobs.Democrats will continue supporting an economy that works for hardworking Americans.

Community Project Spotlight: Queens Diaper Bank

As a mom of two, I know that parenting takes a village. I was proud to deliver $2M in federal funding to start a diaper bank &amp; provide essential baby products to new parents &amp; families throughout our community.

